import Navbar from "./components/Navbar";
import Home from "./components/Home";
import { BrowserRouter as Router,Route, Routes} from 'react-router-dom';


import './App.css';


function App() {
  return (
    <>
    <Router>
     <Navbar/>
      <Routes>

          <Route exact path='/' component={Home}/>
          <Route path='/home' component={Home}/>

      </Routes>
    </Router>
    </>

  );
}

export default App;
